CREATE SEQUENCE airways_id_seq
	INCREMENT BY 1
	MINVALUE 1
	MAXVALUE 9223372036854775807
	START 1
	CACHE 1
	NO CYCLE;

CREATE TABLE airways (
	id int8 NOT NULL DEFAULT nextval('airways_id_seq'::regclass),
	ident varchar NULL,
	source_ident varchar NULL,
	target_ident varchar NULL,
	distance float4 NULL,
	reverse_distance float4 NULL,
	geometry public.geometry NULL
);
CREATE INDEX airways_index_id ON airways USING btree (id);
CREATE INDEX airways_index_geometry ON airways USING gist (geometry);
CREATE INDEX airways_index_idents ON airways USING btree (source_ident, target_ident, ident);

